import React, { useContext } from 'react';
import AppA from './components/ComponentA'

const FirstName = useContext()
const LastName = useContext()

const App = (()=>{
    return (
        <>
            <FirstName.Provider value = {"Piyush"}>
                <LastName.Provider value = {"Bhoyar"}>
                    <AppA/>
                </LastName.Provider>
            </FirstName.Provider>
        </>
    )
})
export default App
